  false,\n\t\"url\": null,\n\t\"notes\": \"A recent BLM survey has determined that
  the 45.33-acre Pig Island, located in St. Joseph Bay, Gulf County, Florida, is public
  domain.  The island has an unusual ecology and is considered a natural area.  The
  State of Florida has included the island in its St. Joseph Bay Aquatic Preserve.
  \ No development is planned for the island as it will be retained in its present
  primitive state. It will be administered from the St. Vincent NWR, located nine
  miles to the east.  This report includes information on the history, geology, and
  biological characteristics of the island.\",\n\t\"license_title\": \"License Not
